        self.label.setText(_translate("MainPage", "Как научиться быстро считать в уме?"))
        self.label_2.setText(_translate("MainPage", "1. Сложение"))
        self.label_3.setText(_translate("MainPage", "<html><head/><body><p>Чтобы сложить два больших числа, можно разбить их на разрядные части, а потом складывать эти части между собой.</p><p>Например, сложение чисел <span style=\" font-weight:600;\">356</span> и <span style=\" font-weight:600;\">728</span> выполняется так:</p><p>1. <span style=\" font-weight:600;\">356 = 300 + 50 + 6</span></p><p>2. <span style=\" font-weight:600;\">728 = 700 + 20 + 8</span></p><p>Тогда <span style=\" font-weight:600;\">356 + 728 = (300+700) + (50+20) + (6+8) = 1000 + 70 + 14 = 1084</span></p></body></html>"))
        self.label_6.setText(_translate("MainPage", "2. Вычитание"))
        self.label_7.setText(_translate("MainPage", "<html><head/><body><p>Разбивается на части только вычитаемое. Например, возьмём числа <span style=\" font-weight:600;\">528</span> и <span style=\" font-weight:600;\">321</span>:</p><p>1. <span style=\" font-weight:600;\">321 = 300 + 20 + 1</span></p><p>2. <span style=\" font-weight:600;\">528 - 300 - 20 - 1 = 207</span><br/></p></body></html>"))
        self.label_8.setText(_translate("MainPage", "3. Умножение"))
        self.label_9.setText(_translate("MainPage", "<html><head/><body><p>Для умножения многозначного числа на однозначное нужно разбить первое число на разряды, каждый разряд умножить на второе число.<br/><span style=\" font-weight:600;\">528 * 6 = 500*6 + 20*6 + 8*6 = 3000 + 120 + 48 = 3168</span></p><p>Для умножения двух многозначных чисел нужно свести всю операцию к умножению на однозначные числа.</p><p><span style=\" font-weight:600;\">28 * 32 = 28 * (30 + 2) = (20 + 8) * 30 + (20 + 8) * 2 = 20 * 30 + 8 * 30 + 20 * 2 + 8 * 2 = 600 + 240 + 40 + 16 = 896</span></p><p>Чтобы умножить двузначное число на <span style=\" font-weight:600;\">11</span>, две цифры числа складываем друг с другом и получившуюся сумму вписываем между цифрами исходного числа. Получаем ответ.<br/><span style=\" font-weight:600;\">54 * 11 = 5(5+4)4 = 594</span></p></body></html>"))
        self.label_10.setText(_translate("MainPage", "4. Деление"))
        self.label_11.setText(_translate("MainPage", "<html><head/><body><p>При делении многозначных чисел на однозначное необходимо выделять наибольшую часть, которую можно разделить с помощью таблицы умножения. Рассмотрим деление числа <span style=\" font-weight:600;\">6144 на 8</span>:</p><p><span style=\" font-weight:600;\">6144 : 8 = (5600+544) : 8 = 700 + 544 : 8</span></p><p>То же самое необходимо повторить и с числом <span style=\" font-weight:600;\">544</span>:</p><p><span style=\" font-weight:600;\">544 : 8 = (480 + 64) : 8 = 60 + 8 = 68</span></p><p><span style=\" font-weight:600;\">700 + 68 = 768</span></p><p><br/></p><p><span style=\" font-weight:600;\">Признак делимости на 2: число делится на 2, если последняя его цифра четная или ноль. 1250 : 2 = 625</span></p><p><span style=\" font-weight:600;\">Признак делимости на 3 и на 9: число делится на 3, если сумма его цифр делится на 3; на 9, если сумма его цифр делится на 9. <br/>17835 = 1 + 7 + 8 + 3 + 5 = 24. 24 делится на 3 и не делится на 9. 17835 делится на 3 и не делится на 9.</span></p><p><span style=\" font-weight:600;\">Признак делимости на 4: число делится на 4, если последние две его цифры это нули или образуют число, делящееся на 4.<br/>16608 делится на 4, поскольку две последние цифры образуют число 8, делящееся на 4</span></p><p><span style=\" font-weight:600;\">Признак делимости на 5: число оканчивается на 0 или 5.<br/>240 : 5 = 48</span></p><p><span style=\" font-weight:600;\">Признак делимости на 6: число делится и на 2, и на 3.<br/>126 : 6 = 21, поскольку 126 делится и на 2, и на 3.</span></p><p><span style=\" font-weight:600;\">Признак делимости на 7: число делится на 7, если разница между этим числом без последней цифры и удвоеннной последней цифрой делится на 7. Этот признак можно применять к числу рекурсивно несколько раз подряд, пока число не станет достаточно маленьким.<br/>364. это 36 и 4*2 = 8. 36 - 8 = 28, а 28 делится на 7. Поэтому и число 364 делится на 7.</span></p><p><span style=\" font-weight:600;\">Признак делимости на 8: число делится на 8, если три последние цифры его нули или образуют число, делящееся на 8.<br/>111120 делится на 8, поскольку три последние цифры числа равны 120, а 120 делится на 8.</span></p><p><span style=\" font-weight:600;\">Признаки делимости на 10, 100 и т.д.: на 10 делятся только те числа, последняя цифра которых - нуль, на 100 - те числа, у которых последние две цифры нули, и т.д.</span></p><p><span style=\" font-weight:600;\">Признак делимости на 11: модуль разности сумм четных и нечетных разрядов равен нулю или делится на 11.<br/>737 делится на 11, т.к. |(7+7)-3| = 11, а 11:11 = 1<br/>1364 делится на 11, т.к. |(1+6)-(3+4)| = 0</span></p><p><br/></p></body></html>"))
