        self.label_13.setText(_translate("MainPage", "<html><head/><body><p align=\"center\"><span style=\" font-size:18pt;\">Выражения: </span><span style=\" font-size:18pt; color:#00aa00;\">a</span><span style=\" font-size:18pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:18pt; color:#00aa00;\"> + ab + b</span><span style=\" font-size:18pt; color:#00aa00; vertical-align:super;\">2 </span><span style=\" font-size:18pt; color:#00aa00;\">, a</span><span style=\" font-size:18pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:18pt; color:#00aa00;\"> - ab + b</span><span style=\" font-size:18pt; color:#00aa00; vertical-align:super;\">2 </span><span style=\" font-size:18pt; color:#000000;\">-называются соответственно неполный квадрат суммы и неполный квадрат разности.</span></p><p align=\"center\"><span style=\" font-size:18pt;\">Тогда сумма кубов есть произведение суммы двух выражений и неполного квадрата их разности:</span></p><p align=\"center\"><span style=\" font-size:24pt; color:#00aa00;\">(a+b)(a</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\">-ab+b</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\">) = a</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">3</span><span style=\" font-size:24pt; color:#00aa00;\"> - a</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\">b + ab</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\"> + a</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\">b - ab</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\"> + b</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">3</span><span style=\" font-size:24pt; color:#00aa00;\"> = a</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">3</span><span style=\" font-size:24pt; color:#00aa00;\"> + b</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">3</span></p><p align=\"center\"><span style=\" font-size:24pt; color:#00aa00;\">8x</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">3</span><span style=\" font-size:24pt; color:#00aa00;\"> + y</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">6</span><span style=\" font-size:24pt; color:#00aa00;\"> = (2x + y</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\">)(4x</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\"> - 2xy</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\"> + y</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">4</span><span style=\" font-size:24pt; color:#00aa00;\">)</span></p><p align=\"center\"><span style=\" font-size:18pt;\">А разность кубов есть произведение разности двух выражений и неполного квадрата их суммы:</span></p><p align=\"center\"><span style=\" font-size:24pt; color:#00aa00;\">(a-b)(a</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\">+ab+b</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\">) = a</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">3</span><span style=\" font-size:24pt; color:#00aa00;\"> + a</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\">b + ab</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\"> - a</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\">b - ab</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\"> - b</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">3</span><span style=\" font-size:24pt; color:#00aa00;\"> = a</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">3</span><span style=\" font-size:24pt; color:#00aa00;\"> + b</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">3</span></p><p align=\"center\"><span style=\" font-size:24pt; color:#00aa00;\">27x</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">6</span><span style=\" font-size:24pt; color:#00aa00;\"> - y</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">12</span><span style=\" font-size:24pt; color:#00aa00;\"> = (3x</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\"> - y</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">4</span><span style=\" font-size:24pt; color:#00aa00;\">)(9x</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">4</span><span style=\" font-size:24pt; color:#00aa00;\"> + 3x</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">2</span><span style=\" font-size:24pt; color:#00aa00;\">y</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">4</span><span style=\" font-size:24pt; color:#00aa00;\"> + y</span><span style=\" font-size:24pt; color:#00aa00; vertical-align:super;\">8</span><span style=\" font-size:24pt; color:#00aa00;\">)</span></p></body></html>"))
