        self.label_14.setText(_translate("MainPage", "<html><head/><body><p align=\"center\"><span style=\" font-size:18pt; color:#cc8800;\">Квадратным корнем из числа a называют число, квадрат которого равен a.</span></p><p align=\"center\"><span style=\" font-size:18pt; color:#000000;\">Так, квадратными корнями из числа 16 являются числа 4 и -4, поскольку 4</span><span style=\" font-size:18pt; color:#000000; vertical-align:super;\">2</span><span style=\" font-size:18pt; color:#000000;\"> = (-4)</span><span style=\" font-size:18pt; color:#000000; vertical-align:super;\">2</span><span style=\" font-size:18pt; color:#000000;\"> = 16</span></p><p align=\"center\"><span style=\" font-size:18pt; color:#000000;\">Квадратным корнем из числа 0 является только число 0: никакое другое число в квадрате не будет равняться нулю.<br/></span><span style=\" font-size:18pt; color:#ff4800;\">Квадратный корень из отрицательного числа не существует, ведь не существует числа, квадрат которого мог бы равняться отрицательному числу. </span></p><p align=\"center\"><span style=\" font-size:18pt; color:#cc8800;\">Арифметическим квадратным корнем из числа a называют неотрицательное число, квадрат которого равен a. Обозначают такой корень как √a и называют </span><span style=\" font-size:20pt; font-weight:600; color:#cc8800;\">радикалом</span><span style=\" font-size:18pt; color:#cc8800;\"> либо же </span><span style=\" font-size:20pt; font-weight:600; color:#cc8800;\">знаком квадратного корня</span><span style=\" font-size:18pt; color:#cc8800;\">.<br/></span><span style=\" font-size:18pt; color:#000000;\">Такую запись читают: «</span><span style=\" font-size:18pt; font-style:italic; color:#000000;\">квадратный корень из a</span><span style=\" font-size:18pt; color:#000000;\">»<br/>Выражение, стоящее под знаком радикала, называют подкоренным выражением. Так, в выражении √b-5 двучлен b-5 есть подкоренное выражение. </span><span style=\" font-size:18pt; color:#cc8800;\">Понятно из определения арифметического квадратного корня, что подкоренное выражение может принимать только неотрицательные значения.</span></p><p align=\"center\"><span style=\" font-size:18pt; color:#cc8800;\">Действие нахождения арифметического квадратного корня из числа называют </span><span style=\" font-size:20pt; font-weight:600; color:#cc8800;\">извлечением квадратного корня. Равенство √a = b выполняется при условии, что b </span><span style=\" font-size:20pt; font-weight:600; text-decoration: underline; color:#cc8800;\">&gt;</span><span style=\" font-size:20pt; font-weight:600; color:#cc8800;\"> 0 и b</span><span style=\" font-size:20pt; font-weight:600; color:#cc8800; vertical-align:super;\">2</span><span style=\" font-size:20pt; font-weight:600; color:#cc8800;\"> = a.<br/></span><span style=\" font-size:18pt; color:#00b100;\">Так, √9 = 3, т.к. 3 </span><span style=\" font-size:18pt; text-decoration: underline; color:#00b100;\">&gt;</span><span style=\" font-size:18pt; color:#00b100;\"> 0 и 3</span><span style=\" font-size:18pt; color:#00b100; vertical-align:super;\">2</span><span style=\" font-size:18pt; color:#00b100;\"> = 9;<br/>√0 = 0, т.к. 0 </span><span style=\" font-size:18pt; text-decoration: underline; color:#00b100;\">&gt;</span><span style=\" font-size:18pt; color:#00b100;\"> 0 и 0</span><span style=\" font-size:18pt; color:#00b100; vertical-align:super;\">2</span><span style=\" font-size:18pt; color:#00b100;\"> = 0.</span><span style=\" font-size:18pt; color:#cc8800;\"><br/></span></p></body></html>"))
